      SELECT - ( col1 ) * - - 18 * ( + col0 ) - + 16 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN col0 + + + 6 + + - col0 * + 34 AND NULL;
  - name: tab0

outputs:
  - name: q9849.out
    data: |
